script: |
  super -f text -I q9133.spq | sort > q9133.out

inputs:
  - name: q9133.spq
    data: |
      SELECT ALL + col1 FROM tab1 (FORMAT parquet) WHERE NOT - col0 IN ( col1 * - - 71, col0 + - col0, - + 24, - col1 * 4 * col0 );
  - name: tab1

outputs:
  - name: q9133.out
    data: |
      14
      47
      5
